"use strict";
// Primitive Data Types
/*
    implicit --> suggested though not directly expressed
    explicit --> stated clearly and in detail, leaving no room for confusion or doubt.

    # When type infer by TypeScript that will implicit data types
    # When type define by programmer that will explicit data types
*/
// string
var institueName = "Programming Hero";
// number
var establishedYear = 2020;
// boolean
var isFamous = true;
// undefined
var a = undefined;
// null
var b = null;
// Non Primitive Data Types
// Array
var cousinList = ["Fahim", "Imram", "Jarif", "Jaifa", "Promi", "Nuha"];
var age = [10, 8, 4, 1, 16, 9];
// tuple
var ageName = ["Yeasin", 23];
ageName[0] = "Arafat";
